import Map from "./Map";
import styled from "styled-components";

const MapBox = styled.div`
  height: 21rem;
  width: 97%;
  align-items: center;
  margin: 0 auto;
`;

const MapTemplate = () => {
  return (
    <MapBox>
      <Map />
    </MapBox>
  );
};

export default MapTemplate;
